import React from "react";
import { motion } from "framer-motion";
import Box from ""
export default function page2(){
    
    return(
        <div>
            <section className="div1"> </section>
            <section className="div2" >
                <motion.h1  initial={{marginleft:0}}
               whileInView={{marginleft:-100}}>slfjsl</motion.h1>
               
                 </section>
                 <Box/>
        </div>
    )
        
    
}
